import React from "react";
import Avatar from "./Avatar";

function note(props) {
  return ( <
    div className = "card" > < div className = "top" >
    <
    h1 className = "name" > {
      props.name
    } < /h1> <Avatar image={props.image} / > < /div> <
    div className = "bottom" >
    <
    p className = "info" > {
      props.tel
    } < /p> <p className="info"> {props.email} </p > < /div> < /
    div >
  );
}

export default note;
